import React from "react";
import StepOne from "./StepOne";
import StepTwo from "./StepTwo";

const CalculatorForm = ({ shapes, setShape, state }) => {
  return (
    <div>
      <StepOne shapes={shapes} setShape={setShape} state={state} />
      <StepTwo shapes={shapes} setShape={setShape} state={state} />
    </div>
  );
};

export default CalculatorForm;
